import React,{useContext, useEffect, useState} from 'react';
import '../pages/PokeDetails.css';
import { PokeVerisi } from '../../../App';

function PokeDetails() {
    const [pokemon,setPokemon]=useState([]);
    useEffect(()=>{
        setPokemon(useContext(PokeVerisi))
    })
  return (
    <div className='pokeDetail'>
        <div className='pokeDetailCart'>
            <div className='pokeImg'>
                <img src={`https://img.pokemondb.net/artwork/large/${"charmeleon"}.jpg`} alt={"charmeleon"} />
            </div>
            <div className='pokeInfo'></div> 
        </div>
    </div>
  )
}

export default PokeDetails
